import Axios from "../utils/axios"

const getUsers = async (data: any) => {
    return await Axios.get('user',data);
}

const getUser = async (data: any,id:number) => {
    return await Axios.get('user/'+id,data);
}

const deleteUser = async (id:number) => {
    return await Axios.delete('user/'+id);
}

const updateUser = async (data: FormData,id:number) => {
    return await Axios.post('user/'+id,data);
}

const userAPI = {
    getUser,
    getUsers,
    deleteUser,
    updateUser,
}

export default userAPI;
